$(function(){$.ajax({type:"POST",data:"{count:10}",dataType:"json",url:"/Timeline.asmx/GetTweets",contentType:"application/json; charset=utf-8",success:onSuccess,cache:false,error:ajaxFailed})});function onSuccess(a,c){$("#tweets").empty();for(var b=0;b<a.d.length;b++){$("#tweets").append('<div>   <div><img src="'+a.d[b].ProfileImage+'" alt=""/>       <h1>'+a.d[b].DisplayName+"</h1>   </div>   <div>"+a.d[b].StatusHtml+"</div></div>")}}function ajaxFailed(a){};